This class helps you make cached method calls, and ensures the delegate is called only once in multithreaded environments.

Useful for loading resources from external urls, making web service calls, running expensive calculations, etc.

Sample usage:
var result = cm.CachedCall("my_key", 30, delegate() {
    return ExpensiveAndTimeConsumingMethodWithParams(...);
});

or 

var result = cm.CachedCall("my_key", 30, ExpensiveAndTimeConsumingMethod);

Style your Form with CSS

public partial class Form1 : CSSForm
...
Style = "btn { property: value; }";

value can be: 'string', red, 12px, rgb(255,255,255), rgba(255,255,255,255);
hlsl(120,12,14), url('path');

Concise BDD test framework.

[Test]
public void IWantTo() {
  ICustomer customer = new Customer();
  SoThat(BusinessValue)
    .As(User)
    .Given(customer.Register)
    .When(customer.Confirm)
    .Then(customer.Login)
}

JsonPoke and JsonPeek build tasks:
Usage :
    <JsonPoke JsonInputPath="$(MSBuildProjectDirectory)\Project.json" Value="Empty-FromTest" JPath="Project.Name">
    </JsonPoke>
    <JsonPoke JsonInputPath="$(MSBuildProjectDirectory)\Project.json" Value="Empty-FromTest" JPath="Project.IncludedLibraryVariableSetIds[?(@.Name == 'Lib-68')].Value">
    </JsonPoke>
    <JsonPeek JsonInputPath="$(MSBuildProjectDirectory)\Project.json" JPath="Project.IncludedLibraryVariableSetIds[?(@.Name == 'Lib-69')].Value">
      <Output TaskParameter="Result" ItemName="Lib69Value" />
    </JsonPeek>
    <PropertyGroup>
      <JsonContent>
        <![CDATA[{
  "Project": {
    "Id": "project1",
    "IncludedLibraryVariableSetIds": [
      {
        "Name": "Lib-68",
        "Value": "Empty-FromTest"
      },
      {
        "Name": "Lib-69",
        "Value": "ToBeReplaced"
      },
      {
        "Name": "Lib-69",
        "Value": "ToBeReplaced1"
      }
    ],
    "DefaultToSkipIfAlreadyInstalled": false,
    "VersioningStrategy": {
      "DonorPackageStepId": "2624300c-958e-45ec-ae87-aadb3a3df790",
      "Template": null
    },
    "Name": "Empty-FromTest",
    "Description": "",
    "IsDisabled": false
  }
}
  ]]>
      </JsonContent>
    </PropertyGroup>
    <JsonPeek JPath="Project.IncludedLibraryVariableSetIds[?(@.Name == 'Lib-69')].Value" JsonContent="$(JsonContent)">    
      <Output TaskParameter="Result" ItemName="Lib69Value_FromContent" />
    </JsonPeek>
    <Message Text="Project.IncludedLibraryVariableSetIds[?(@.Name == 'Lib-69')].Value : @(Lib69Value)" />
    <Message Text="Project.IncludedLibraryVariableSetIds[?(@.Name == 'Lib-69')].Value From JsonContent : @(Lib69Value_FromContent)" />

